<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <style>
      body {
        background-color: white;
      }
    </style>
  </head>
  <body>
    <div
      id="aeqsajgabp"
      style="overflow-x: auto; overflow-y: auto; width: auto; height: auto"
    >
      <style>
        html {
          font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto,
            Oxygen, Ubuntu, Cantarell, 'Helvetica Neue', 'Fira Sans',
            'Droid Sans', Arial, sans-serif;
        }

        #aeqsajgabp .gt_table {
          display: table;
          border-collapse: collapse;
          margin-left: auto;
          margin-right: auto;
          color: #333333;
          font-size: 16px;
          font-weight: normal;
          font-style: normal;
          background-color: #ffffff;
          width: auto;
          border-top-style: solid;
          border-top-width: 2px;
          border-top-color: #a8a8a8;
          border-right-style: none;
          border-right-width: 2px;
          border-right-color: #d3d3d3;
          border-bottom-style: solid;
          border-bottom-width: 2px;
          border-bottom-color: #a8a8a8;
          border-left-style: none;
          border-left-width: 2px;
          border-left-color: #d3d3d3;
        }

        #aeqsajgabp .gt_heading {
          background-color: #ffffff;
          text-align: center;
          border-bottom-color: #ffffff;
          border-left-style: none;
          border-left-width: 1px;
          border-left-color: #d3d3d3;
          border-right-style: none;
          border-right-width: 1px;
          border-right-color: #d3d3d3;
        }

        #aeqsajgabp .gt_title {
          color: #333333;
          font-size: 125%;
          font-weight: initial;
          padding-top: 4px;
          padding-bottom: 4px;
          padding-left: 5px;
          padding-right: 5px;
          border-bottom-color: #ffffff;
          border-bottom-width: 0;
        }

        #aeqsajgabp .gt_subtitle {
          color: #333333;
          font-size: 85%;
          font-weight: initial;
          padding-top: 0;
          padding-bottom: 6px;
          padding-left: 5px;
          padding-right: 5px;
          border-top-color: #ffffff;
          border-top-width: 0;
        }

        #aeqsajgabp .gt_bottom_border {
          border-bottom-style: solid;
          border-bottom-width: 2px;
          border-bottom-color: #d3d3d3;
        }

        #aeqsajgabp .gt_col_headings {
          border-top-style: solid;
          border-top-width: 2px;
          border-top-color: #d3d3d3;
          border-bottom-style: solid;
          border-bottom-width: 2px;
          border-bottom-color: #d3d3d3;
          border-left-style: none;
          border-left-width: 1px;
          border-left-color: #d3d3d3;
          border-right-style: none;
          border-right-width: 1px;
          border-right-color: #d3d3d3;
        }

        #aeqsajgabp .gt_col_heading {
          color: #333333;
          background-color: #ffffff;
          font-size: 100%;
          font-weight: normal;
          text-transform: inherit;
          border-left-style: none;
          border-left-width: 1px;
          border-left-color: #d3d3d3;
          border-right-style: none;
          border-right-width: 1px;
          border-right-color: #d3d3d3;
          vertical-align: bottom;
          padding-top: 5px;
          padding-bottom: 6px;
          padding-left: 5px;
          padding-right: 5px;
          overflow-x: hidden;
        }

        #aeqsajgabp .gt_column_spanner_outer {
          color: #333333;
          background-color: #ffffff;
          font-size: 100%;
          font-weight: normal;
          text-transform: inherit;
          padding-top: 0;
          padding-bottom: 0;
          padding-left: 4px;
          padding-right: 4px;
        }

        #aeqsajgabp .gt_column_spanner_outer:first-child {
          padding-left: 0;
        }

        #aeqsajgabp .gt_column_spanner_outer:last-child {
          padding-right: 0;
        }

        #aeqsajgabp .gt_column_spanner {
          border-bottom-style: solid;
          border-bottom-width: 2px;
          border-bottom-color: #d3d3d3;
          vertical-align: bottom;
          padding-top: 5px;
          padding-bottom: 5px;
          overflow-x: hidden;
          display: inline-block;
          width: 100%;
        }

        #aeqsajgabp .gt_group_heading {
          padding-top: 8px;
          padding-bottom: 8px;
          padding-left: 5px;
          padding-right: 5px;
          color: #333333;
          background-color: #ffffff;
          font-size: 100%;
          font-weight: initial;
          text-transform: inherit;
          border-top-style: solid;
          border-top-width: 2px;
          border-top-color: #d3d3d3;
          border-bottom-style: solid;
          border-bottom-width: 2px;
          border-bottom-color: #d3d3d3;
          border-left-style: none;
          border-left-width: 1px;
          border-left-color: #d3d3d3;
          border-right-style: none;
          border-right-width: 1px;
          border-right-color: #d3d3d3;
          vertical-align: middle;
          text-align: left;
        }

        #aeqsajgabp .gt_empty_group_heading {
          padding: 0.5px;
          color: #333333;
          background-color: #ffffff;
          font-size: 100%;
          font-weight: initial;
          border-top-style: solid;
          border-top-width: 2px;
          border-top-color: #d3d3d3;
          border-bottom-style: solid;
          border-bottom-width: 2px;
          border-bottom-color: #d3d3d3;
          vertical-align: middle;
        }

        #aeqsajgabp .gt_from_md > :first-child {
          margin-top: 0;
        }

        #aeqsajgabp .gt_from_md > :last-child {
          margin-bottom: 0;
        }

        #aeqsajgabp .gt_row {
          padding-top: 8px;
          padding-bottom: 8px;
          padding-left: 5px;
          padding-right: 5px;
          margin: 10px;
          border-top-style: solid;
          border-top-width: 1px;
          border-top-color: #d3d3d3;
          border-left-style: none;
          border-left-width: 1px;
          border-left-color: #d3d3d3;
          border-right-style: none;
          border-right-width: 1px;
          border-right-color: #d3d3d3;
          vertical-align: middle;
          overflow-x: hidden;
        }

        #aeqsajgabp .gt_stub {
          color: #333333;
          background-color: #ffffff;
          font-size: 100%;
          font-weight: initial;
          text-transform: inherit;
          border-right-style: solid;
          border-right-width: 2px;
          border-right-color: #d3d3d3;
          padding-left: 5px;
          padding-right: 5px;
        }

        #aeqsajgabp .gt_stub_row_group {
          color: #333333;
          background-color: #ffffff;
          font-size: 100%;
          font-weight: initial;
          text-transform: inherit;
          border-right-style: solid;
          border-right-width: 2px;
          border-right-color: #d3d3d3;
          padding-left: 5px;
          padding-right: 5px;
          vertical-align: top;
        }

        #aeqsajgabp .gt_row_group_first td {
          border-top-width: 2px;
        }

        #aeqsajgabp .gt_summary_row {
          color: #333333;
          background-color: #ffffff;
          text-transform: inherit;
          padding-top: 8px;
          padding-bottom: 8px;
          padding-left: 5px;
          padding-right: 5px;
        }

        #aeqsajgabp .gt_first_summary_row {
          border-top-style: solid;
          border-top-color: #d3d3d3;
        }

        #aeqsajgabp .gt_first_summary_row.thick {
          border-top-width: 2px;
        }

        #aeqsajgabp .gt_last_summary_row {
          padding-top: 8px;
          padding-bottom: 8px;
          padding-left: 5px;
          padding-right: 5px;
          border-bottom-style: solid;
          border-bottom-width: 2px;
          border-bottom-color: #d3d3d3;
        }

        #aeqsajgabp .gt_grand_summary_row {
          color: #333333;
          background-color: #ffffff;
          text-transform: inherit;
          padding-top: 8px;
          padding-bottom: 8px;
          padding-left: 5px;
          padding-right: 5px;
        }

        #aeqsajgabp .gt_first_grand_summary_row {
          padding-top: 8px;
          padding-bottom: 8px;
          padding-left: 5px;
          padding-right: 5px;
          border-top-style: double;
          border-top-width: 6px;
          border-top-color: #d3d3d3;
        }

        #aeqsajgabp .gt_striped {
          background-color: rgba(128, 128, 128, 0.05);
        }

        #aeqsajgabp .gt_table_body {
          border-top-style: solid;
          border-top-width: 2px;
          border-top-color: #d3d3d3;
          border-bottom-style: solid;
          border-bottom-width: 2px;
          border-bottom-color: #d3d3d3;
        }

        #aeqsajgabp .gt_footnotes {
          color: #333333;
          background-color: #ffffff;
          border-bottom-style: none;
          border-bottom-width: 2px;
          border-bottom-color: #d3d3d3;
          border-left-style: none;
          border-left-width: 2px;
          border-left-color: #d3d3d3;
          border-right-style: none;
          border-right-width: 2px;
          border-right-color: #d3d3d3;
        }

        #aeqsajgabp .gt_footnote {
          margin: 0px;
          font-size: 90%;
          padding-left: 4px;
          padding-right: 4px;
          padding-left: 5px;
          padding-right: 5px;
        }

        #aeqsajgabp .gt_sourcenotes {
          color: #333333;
          background-color: #ffffff;
          border-bottom-style: none;
          border-bottom-width: 2px;
          border-bottom-color: #d3d3d3;
          border-left-style: none;
          border-left-width: 2px;
          border-left-color: #d3d3d3;
          border-right-style: none;
          border-right-width: 2px;
          border-right-color: #d3d3d3;
        }

        #aeqsajgabp .gt_sourcenote {
          font-size: 90%;
          padding-top: 4px;
          padding-bottom: 4px;
          padding-left: 5px;
          padding-right: 5px;
        }

        #aeqsajgabp .gt_left {
          text-align: left;
        }

        #aeqsajgabp .gt_center {
          text-align: center;
        }

        #aeqsajgabp .gt_right {
          text-align: right;
          font-variant-numeric: tabular-nums;
        }

        #aeqsajgabp .gt_font_normal {
          font-weight: normal;
        }

        #aeqsajgabp .gt_font_bold {
          font-weight: bold;
        }

        #aeqsajgabp .gt_font_italic {
          font-style: italic;
        }

        #aeqsajgabp .gt_super {
          font-size: 65%;
        }

        #aeqsajgabp .gt_footnote_marks {
          font-style: italic;
          font-weight: normal;
          font-size: 75%;
          vertical-align: 0.4em;
        }

        #aeqsajgabp .gt_asterisk {
          font-size: 100%;
          vertical-align: 0;
        }

        #aeqsajgabp .gt_indent_1 {
          text-indent: 5px;
        }

        #aeqsajgabp .gt_indent_2 {
          text-indent: 10px;
        }

        #aeqsajgabp .gt_indent_3 {
          text-indent: 15px;
        }

        #aeqsajgabp .gt_indent_4 {
          text-indent: 20px;
        }

        #aeqsajgabp .gt_indent_5 {
          text-indent: 25px;
        }
      </style>
      <table class="gt_table">
        <thead class="gt_col_headings">
          <tr>
            <th
              class="gt_col_heading gt_columns_bottom_border gt_center"
              rowspan="1"
              colspan="1"
              scope="col"
              id="island"
            >
              island
            </th>
            <th
              class="gt_col_heading gt_columns_bottom_border gt_center"
              rowspan="1"
              colspan="1"
              scope="col"
              id="species"
            >
              species
            </th>
            <th
              class="gt_col_heading gt_columns_bottom_border gt_right"
              rowspan="1"
              colspan="1"
              scope="col"
              id="n"
            >
              n
            </th>
          </tr>
        </thead>
        <tbody class="gt_table_body">
          <tr>
            <td headers="island" class="gt_row gt_center">Biscoe</td>
            <td headers="species" class="gt_row gt_center">Gentoo</td>
            <td headers="n" class="gt_row gt_right">124</td>
          </tr>
          <tr>
            <td headers="island" class="gt_row gt_center">Dream</td>
            <td headers="species" class="gt_row gt_center">Chinstrap</td>
            <td headers="n" class="gt_row gt_right">68</td>
          </tr>
          <tr>
            <td headers="island" class="gt_row gt_center">Dream</td>
            <td headers="species" class="gt_row gt_center">Adelie</td>
            <td headers="n" class="gt_row gt_right">56</td>
          </tr>
          <tr>
            <td headers="island" class="gt_row gt_center">Torgersen</td>
            <td headers="species" class="gt_row gt_center">Adelie</td>
            <td headers="n" class="gt_row gt_right">52</td>
          </tr>
          <tr>
            <td headers="island" class="gt_row gt_center">Biscoe</td>
            <td headers="species" class="gt_row gt_center">Adelie</td>
            <td headers="n" class="gt_row gt_right">44</td>
          </tr>
        </tbody>
      </table>
    </div>
  </body>
</html>
